import * as React from "react";
import {
  Container,
  Modal,
  ModalBackground,
  ModalCard,
  ModalCardBody,
  ModalCardHeader,
  ModalCardTitle,
  Delete,
} from "bloomer";

const CustomModal = () => {
  return (
    <Container>
      <Modal isActive>
        <ModalBackground />
        <ModalCard>
          <ModalCardHeader>
            <ModalCardTitle>ModalCard Title</ModalCardTitle>
            <Delete />
          </ModalCardHeader>
          <ModalCardBody>Hii there</ModalCardBody>
        </ModalCard>
      </Modal>
    </Container>
  );
};
export default CustomModal;
